volatile int pixel_buffer_start;  // global variable
short int Buffer1[240][512];      // 240 rows, 512 (320 + padding) columns
short int Buffer2[240][512];

void plot_pixel(int x, int y, short int line_color);
void wait_for_vsync();
void clear_screen();
void print_static();
void write_char(int x, int y, char c);
void print_time();
void print_samar(int temperature, int speed, int usage);

volatile int *SW_ptr = 0xFF200040;
volatile int *LEDR_ptr = 0xFF200000;

void vgaDriver(int temperature, int speed, int usage) {



	volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
  /* set front pixel buffer to Buffer 1 */
	*(pixel_ctrl_ptr + 1) = (int)&Buffer1;
  /* now, swap the front/back buffers, to set the front buffer location */
	wait_for_vsync();
  /* initialize a pointer to the pixel buffer, used by drawing functions */
	pixel_buffer_start = *pixel_ctrl_ptr;
	clear_screen();  // pixel_buffer_start points to the pixel buffer

  /* set back pixel buffer to Buffer 2 */
	*(pixel_ctrl_ptr + 1) = (int)&Buffer2;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // we draw on the back buffer
	clear_screen(); ;  // pixel_buffer_start points to the pixel buffer

	while (1) {
		print_static();
		print_time();
		
		temperature = *SW_ptr;
		speed = *SW_ptr;
		usage = *SW_ptr;
		//printf("%d\n", temperature);
		print_samar(temperature, speed, usage);
		
		
		wait_for_vsync(); 
		pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	}
}

void print_samar(int temperature, int speed, int usage){
    char temp[10]; // Allocate memory for the string
    sprintf(temp, "%d", temperature);
    int s = 70;
    char *temp_ptr = temp; // Pointer to the beginning of the string

    while (*temp_ptr) {
        write_char(s, 34, *temp_ptr);
        s++;
        temp_ptr++;
    }
	
	char fan_speed[10]; // Allocate memory for the string
    sprintf(fan_speed, "%d", speed);
    int f = 62;
    char *fan_speed_ptr = fan_speed; // Pointer to the beginning of the string

    while (*fan_speed_ptr) {
        write_char(f, 18, *fan_speed_ptr);
        f++;
        fan_speed_ptr++;
    }
	

    printf("%s\n", temp); // Print the entire string
    *LEDR_ptr = temperature;
}



void print_static(){
//print background
	for (int k = 0; k < 153600; k += 2) {
		int red = ((screen_map[k + 1] & 0xF8) >> 3) << 11;
		int green =(((screen_map[k] & 0xE0) >> 5)) | ((screen_map[k + 1] & 0x7) << 3);
		int blue = (screen_map[k] & 0x1f);

		short int p = red | ((green << 5) | blue);
		plot_pixel((k / 2) % 320, (k / 2) / 320, p);
	}
//print characters	
	char* processor = "Intel:    NIOS(R) II";
	int a = 2;
	while (*processor) {
		write_char(a, 23, *processor);
		a++;
		processor++;
	}
	char* performance = "Speed:    @165MHz";
	int b = 2;
	while (*performance) {
		write_char(b, 25, *performance);
		b++;
		performance++;
	}
	char* memory = "Size:     1 GB DDR3";
	int c = 2;
	while (*memory) {
		write_char(c, 34, *memory);
		c++;
		memory++;
	}
	char* temperature_is = "CPU Temperature: ";
	int d = 52;
	while (*temperature_is) {
		write_char(d, 34, *temperature_is);
		d++;
		temperature_is++;
	}
	
	char* fan = "Ext. Fan: ";
	int e = 52;
	while (*fan) {
		write_char(e, 18, *fan);
		e++;
		fan++;
	}
	
	char* load = "Current Load: ";
	int f = 52;
	while (*load) {
		write_char(e, 36, *load);
		f++;
		load++;
	}
}


void print_time() {
	time_t current_time;
    struct tm *time_info;
	time(&current_time);
	time_info = localtime(&current_time);

	int d = 42;

    write_char(12, d, (time_info->tm_hour / 10) + '0'); // Print tens digit of hour
    write_char(13, d, (time_info->tm_hour % 10) + '0'); // Print ones digit of hour
    write_char(14, d, ':'); // Print colon separator
    write_char(15, d, (time_info->tm_min / 10) + '0');  // Print tens digit of minute
    write_char(16, d, (time_info->tm_min % 10) + '0');  // Print ones digit of minute
    write_char(17, d, ':'); // Print colon separator
    write_char(18, d, (time_info->tm_sec / 10) + '0');  // Print tens digit of second
    write_char(19, d, (time_info->tm_sec % 10) + '0');  // Print ones digit of second
	
	char *date = "Tue Apr 9";
    int e = 2;
    while (*date) {
        write_char(e, 42, *date);
        e++;
        date++;
    }
	
	char *year = " 2024";
    int f = 20;
    while (*year) {
        write_char(f, 42, *year);
        f++;
        year++;
    }
	
}

void clear_screen() {
  for (int i = 0; i < 320; i++) {
    for (int j = 0; j < 240; j++) {
      plot_pixel(i, j, 0x0000);
    }
  }
}

void write_char(int x, int y, char c) {
  // VGA character buffer
  volatile char * character_buffer = (char *) (0x09000000 + (y<<7) + x);
  *character_buffer = c;
}

void plot_pixel(int x, int y, short int line_color) {
  volatile short int *one_pixel_address;
  one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
  *one_pixel_address = line_color;
}

void wait_for_vsync() {
  volatile int *pixel_ctrl_ptr = (int *)0xff203020;  // base address
  int status;
  *pixel_ctrl_ptr = 1;  // start the synchronization process
  // write 1 into front buffer address register
  status = *(pixel_ctrl_ptr + 3);  // read the status register
  while ((status & 0x01) != 0)     // polling loop waiting for S bit to go to 0
  {
    status = *(pixel_ctrl_ptr + 3);
  }  // loop/function exits when status bit goes to 0
}

